import axios from "axios"



export const Flogin=(email,password)=> async(dispatch)=>{
    const res= await axios.post('http://localhost:5000/users/login',{email,password})
    dispatch({
        type:'SET_LOGIN',
        payload:res.data
    })
    console.log(res.data)
}
